-- Migration 003: Replace old work units with new eigensolve format
-- Delete old work units and results
DELETE FROM results;
DELETE FROM work_units;

-- Update consensus trigger for new result format
CREATE OR REPLACE FUNCTION check_consensus() RETURNS trigger AS $$
DECLARE
  v_other results;
  v_tolerance float := 1e-10;
  v_new_energy float;
  v_other_energy float;
BEGIN
  SELECT * INTO v_other FROM results
    WHERE work_unit_id = NEW.work_unit_id
    AND id != NEW.id
    LIMIT 1;

  IF v_other.id IS NOT NULL THEN
    v_new_energy := (NEW.result->>'ground_state_energy')::float;
    v_other_energy := (v_other.result->>'ground_state_energy')::float;
    IF abs(v_new_energy - v_other_energy) < v_tolerance THEN
      UPDATE work_units
        SET status = 'complete',
            completed_count = 2,
            consensus_result = NEW.result
        WHERE id = NEW.work_unit_id;
    ELSE
      UPDATE work_units
        SET completed_count = completed_count + 1
        WHERE id = NEW.work_unit_id;
    END IF;
  ELSE
    UPDATE work_units
      SET completed_count = 1
      WHERE id = NEW.work_unit_id;
  END IF;

  UPDATE contributors
    SET total_units = total_units + 1, last_seen_at = now()
    WHERE id = NEW.contributor_id;

  RETURN NEW;
END;
$$ LANGUAGE plpgsql;

